import avatar1 from '../assets/avatar1.png';
import avatar2 from '../assets/avatar2.png';
import avatar3 from '../assets/avatar3.png';
import avatar4 from '../assets/avatar4.png';
import avatar5 from '../assets/avatar5.png';

export const peopleRanking = [
    { id: 1, name: 'Dimitri Ivanovic', points: '2500', percentage: '100%', avatar: avatar1 },
    { id: 2, name: 'Anna Nowak', points: '2000', percentage: '80%', avatar: avatar2 },
    { id: 3, name: 'Jan Kowalski', points: '1500', percentage: '60%', avatar: avatar3 },
    { id: 4, name: 'John Smith', points: '1000', percentage: '40%', avatar: avatar4 },
    { id: 5, name: 'John Snow', points: '500', percentage: '20%', avatar: avatar5 },
];
